@goth600 
In short: not likely, the work needed to fold proteins are quite computationally intensive and generally apply image techniques

The long answer: So google's alphafold (which I'm assuming you are referring to) does a mixture of distance and contact matrix prediction in combination with a statisical potential using the rosetta energy and the van der waals forces. The actual design is still quite well guarded, the last time I looked into alphafold, but the techniques that they use are closer to that of the image modality. When we launch our image modality later this year, DNA contact predictions are one of the tasks that we can tackle
